import { useState } from "react"
import { Button, Form, InputGroup } from "react-bootstrap"
import "./Movie.css"
import MovieCard from "./MovieCard"
const movieData = {
    movies: [
        { id: 1, movieName: "A" },
        { id: 2, movieName: "B" },
        { id: 3, movieName: "C" },
        { id: 4, movieName: "D" },
        { id: 5, movieName: "E" }
    ],
    selectedMovie: []
}

function MainAap() {
    const [state, setState] = useState(movieData)
    return <div className="mainMovie">
        <InputGroup className="mb-3">
            <Form.Control aria-label="Text input " />
            <Button variant="warning">Search</Button>
        </InputGroup>

        <div className="cards d-flex">
            {state.movies.map((item) => {
                return <MovieCard key={item.id} data={state} />
            })}
        </div>

    </div>
}
export default MainAap
